import React, { Component } from 'react';
import API from '../../../../../utils/API';


class TableItem extends Component{
    constructor(props){
        super(props);
        this.state = {
            item: []
        }
    };

    ComponentWillUpdate(){
        API.limit().then((response) => {
            this.setState({item: response.data})
        }).catch((err) => {
            console.log(err)
        })
    }
}

